import "./config"
import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import App from './App';
import {AuthCluster} from './clusters/auth-cluster';
import {RecoilRoot} from "recoil"

ReactDOM.render(
  <React.StrictMode>
    <RecoilRoot>
      <App />
      <AuthCluster />
    </RecoilRoot>
  </React.StrictMode>,
  document.getElementById('root')
);
